import React, { useE ,useState } from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom"; // Import Routes instead of Switch

import "./App.css";
import Videos from "./Videos.js";

function App() {
  const [loadData, setLoadData] = useState([]);
  const [showVideos, setShowVideos] = useState(false);
  useEffect(() => {
    const getData = async () => {
      try {
        const response = await fetch("http://localhost:3000/videos");
        if (!response.ok) {
          throw new Error("something went wrong");
        }
        const data = await response.json();
        console.log("Response data:", data);
        return setLoadData(data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };
    getData();
  }, [setLoadData]);
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Video Recommendation</h1>
        </header>
        <nav className="nav">
          <Link to="/videos" onClick={() => setShowVideos(true)}>
            Videos
          </Link>
        </nav>
        <Routes>
          {" "}

          <Route path="/videos" element={<Videos show={showVideos} setShow={setShowVideos} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
